oxy_webhelp_navlinks = {"ibml_configuration-d43829e33969":{"topics":[{"title":"Integration with modelling software ","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to equip TAC with the         capacity to process information sourced from the modelling software and to convert this         information into accounting transactions.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_98131_en\/code_98131_functional.html","attributes":{"data-id":"code_98131_functional"},"menu":{"hasChildren":false},"tocID":"code_98131_functional-d43829e33987","topics":[]},{"title":"Possibility of not generating accounting transactions for specific documents\/events","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to allow not considering         specific documents\/events for accounting purposes in TAC, whenever deemed         appropriate.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_90610_en\/code_90610_functional_2.html","attributes":{"data-id":"code_90610_functional"},"menu":{"hasChildren":false},"tocID":"code_90610_functional-d43829e34005","topics":[]},{"title":"Integration with Cleva Accounting","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to enable the integration         between TAC and Cleva Accounting (FAC), thus allowing the accounting transactions produced         by TAC to be entered into FAC automatically.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_98151_en\/code_98151_functional_3.html","attributes":{"data-id":"code_98151_functional"},"menu":{"hasChildren":false},"tocID":"code_98151_functional-d43829e34023","topics":[]}]}};